/**
 * 请求参数类型名称
 */
let paramsTypeName = "";
/**
 * 相应类型名称
 */
let resTypeName = "";

const apiMethod = ["POST", "GET", "DELETE", "PUT"];

const checkApiMethod = (funName) => {
  let method = "";
  for (let index = 0; index < apiMethod.length; index++) {
    const item = apiMethod[index];
    const checkStr = "-" + item;
    if (funName.includes(checkStr)) {
      method = item;
      break;
    }
  }
  return method;
};

const adjustName = (name, isLowerFirst = true) => {
  const firstCaseFun = isLowerFirst ? _.lowerCase : _.upperFirst;
  const newName = firstCaseFun(
    _.camelCase(
      name
        .replace(/-GET(by-)?/, "-get-$1")
        .replace(/-POST(by-)?/, "-post-$1")
        .replace("-PUT", "-put-")
        .replace(/-DELETE(by-)?/, "-delete-$1")
        .replace("Controller", "")
    )
  );
  return newName;
};

const buildApiFun = (annotation, name, paramsName, paramsType, url) => {
  if ([annotation, name, url].includes("")) return "";
  const method = checkApiMethod(name);
  const newName = adjustName(name, false);
  const newParamsName = _.lowerFirst(_.camelCase(paramsName));
  // 如果以 id 结尾，类型替换为 string；
  const finalParamsType = _.lowerCase(paramsName).endsWith("id")
    ? "string"
    : paramsType;
  const funParams = newParamsName && `${newParamsName}: ${finalParamsType}, `;
  const apiParamsName = method === "GET" ? "params" : "data";
  const apiParams = newParamsName && `,\n${apiParamsName}: ${newParamsName}`;
  const funContent = `${annotation}export const ${newName} = (${funParams}req: AxiosInstance = request) => {
    return req<${resTypeName}>({
      url: '${url}',
      method: '${method}'${apiParams}
    })
  }`;
  return funContent;
};

const getApiFun = (content) => {
  const apiFunReg =
    /(\/\*\*[\s\S]*)export function (.*)\(.*: Promise<.*> \{\n.*return request\..*`(\/.*)`/;
  const funMatch = content.match(apiFunReg);
  const apiFunRegWithParams =
    /(\/\*\*[\s\S]*)export function (.*)\((.*): (.*)\): Promise<.*> \{\n.*return request\..*`(\/.*)`/;
  const funWithParamsMatch = content.match(apiFunRegWithParams);

  let annotation = "";
  let name = "";
  let url = "";
  let paramsName = "";
  if (funWithParamsMatch) {
    annotation = funWithParamsMatch[1];
    name = funWithParamsMatch[2];
    paramsName = adjustName(funWithParamsMatch[3]);

    // 前面已经取值了，就不要自己取了
    paramsTypeName = paramsTypeName || adjustName(funWithParamsMatch[4], false);
    url = funWithParamsMatch[5].split("?")[0];
  } else if (funMatch) {
    annotation = funMatch[1];
    name = funMatch[2];
    url = funMatch[3];
  }

  return buildApiFun(annotation, name, paramsName, paramsTypeName, url);
};

/**
 * 处理类型内容部分
 * 1、替换 number 类型的 ID 为 string；
 * 2、paras 类型全部转为 paras?: string;
 * @param {string} content 类型的内容部分
 * @returns
 */
const resetTypeContent = (content) => {
  const newTypeContent = content
    .replace(/(\S*ID\??): number;/g, "$1: string;")
    .replace(/(\S*Paras\??): Record.*;/g, "$1: string")
    .replace(/(\s*Flags\??): .*;/g, "$1: string[]");

  return newTypeContent;
};

const rebuildType = (name, content) => {
  if (name === "" || content === "") return "";
  const newContent = resetTypeContent(content);
  const tsType = `export type ${name} = ${newContent};`;
  return tsType;
};

/**
 *
 * @param {string} content 解析原始内容
 * @param {boolean} removeBasic 是否移除基本类型声明
 * @returns
 */
const parseContent = (content, removeBasic) => {
  // 匹配对象类型接口
  const objReg =
    /export interface (.*) \{\n(.*;\n)+\s*Data: (\{\n(.*\n)+.*\}(\[\])?;)/;
  const objMatch = content.match(objReg);
  // 匹配基本类型接口
  const basicReg = /export interface (.*) \{\n(.*;\n)+\s*Data: (.*;)/;
  const basicMatch = content.match(basicReg);

  let allType = "";

  const paramsReg = /export interface (.*Params) (\{\n(.*;\n)+\})/;
  const paramsMatch = content.match(paramsReg);
  if (paramsMatch) {
    const paramsName = paramsMatch[1];
    const paramsContent = paramsMatch[2];
    const newParamsName = adjustName(paramsName, false);
    paramsTypeName = newParamsName;
    const paramsType = rebuildType(newParamsName, paramsContent);
    allType += paramsType + "\n";
  }

  let resContent = "";
  let resName = "";
  if (objMatch) {
    resName = objMatch[1];
    resContent = objMatch[3].slice(0, -1);
  } else if (basicReg && basicMatch) {
    // resName = basicMatch[1];
    resContent = basicMatch[3].slice(0, -1);
    // 基本数据类型，内容就是类型
    resName = resContent;
  }
  const newResName = adjustName(resName, false);
  resTypeName = basicMatch ? resName : newResName;
  const resType = rebuildType(newResName, resContent);
  // 判断是否移除基础类型接口
  const finalResType = basicMatch && removeBasic ? "" : resType + "\n";

  allType += finalResType;
  return allType;
};

const getContent = () => {
  const scriptPanel = $(
    ".ant-tabs-tabpane.ant-tabs-tabpane-active .api-tab .ant-tabs-content .ant-tabs-tabpane .generate"
  )[0];

  const tsPanel = scriptPanel.children[1];
  const editorEle = tsPanel.lastChild.firstChild;

  const editor = ace.edit(editorEle);
  const content = editor.getValue();
  return content;
};

const resetGlobalVal = () => {
  paramsTypeName = "";
  resTypeName = "";
};

const copyType = (e) => {
  resetGlobalVal();
  const content = getContent();
  const tsContent = parseContent(content, true);
  GM_setClipboard(tsContent, "text", () => message.success("复制类型成功！"));
};

const copyApi = () => {
  resetGlobalVal();
  const content = getContent();
  // 主要是该函数会给全局变量赋值，得到参数类型
  parseContent(content, true);
  const apiFun = getApiFun(content);
  GM_setClipboard(apiFun, "text", () => message.success("复制接口成功！"));
};

const copyFull = () => {
  resetGlobalVal();
  const content = getContent();
  const typeContent = parseContent(content, true);
  const apiFun = getApiFun(content);
  const fullContent = typeContent + "\n" + apiFun;
  GM_setClipboard(fullContent, "text", () => message.success("复制成功！"));
};

$(".copy-type").on("click", copyType);
$(".copy-api").on("click", copyApi);
$(".copy-full").on("click", copyFull);
